export class Cliente {
    codigo: number = 0;
    nome: string = "";
    email: string = "";
    senha: string = "";
    telefone: string = "";

    constructor(obj?:Cliente){

        this.codigo = obj.codigo;
        this.nome = obj.nome;
        this.email = obj.email;
        this.senha = obj.senha;
        this.telefone = obj.telefone;
    }
}
